function handleScroll(e){if(handleScroll.active){delta=e.originalEvent.deltaY;if(delta>10){delta=10}handleScroll.position+=delta;if(handleScroll.position<0){handleScroll.position=0}}if($("#intro").position().top==0){if(handleScroll.active==false&&handleScroll.position>580){handleScroll.position=580}handleScroll.active=true}if(handleScroll.position<581){$("#modelImg").attr("src","./vr/0_"+Math.floor(handleScroll.position/20)+".png");e.preventDefault();e.stopPropagation()}else{handleScroll.active=false}}$(document).ready(function(){$("head").append($("<link rel='stylesheet' href='https://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap.min.css' type='text/css' media='screen' />"));$("head").append($("<link rel='stylesheet' href='css/min/leaflet.min.css' type='text/css' media='screen' />"));$("body").scrollspy({target:".navbar",offset:50});$("#myNavbar a").on("click",function(event){event.preventDefault();var hash=this.hash;if(hash!=""){$(".navbar-collapse.in").collapse("hide");$("html, body").animate({scrollTop:$(hash).offset().top},800,function(){window.location.hash=hash})}});$("body").on({mousewheel:function(e){handleScroll(e)}});if($("#intro").position().top==0){handleScroll.active=true;handleScroll.position=0}else{handleScroll.active=false}});
